pragma solidity ^0.5.0;
contract Dice {
    
    
    address payable public receiver;
    struct Bet{
		uint8  currentBet;
		bool   isBetSet;	
		bool   isHigher;
		uint8  destiny;
		uint8 bet;
	}

	mapping(address => Bet) private bets;
	event NewBetIsSet(address bidder , uint8 currentBet);

	event GameResult(address bidder, uint8 currentBet , uint8 destiny);
	
   function getNewbet(uint8 _bet, bool _isHigher) external payable returns(uint8){
		require(bets[msg.sender].isBetSet == false);
		bets[msg.sender].isBetSet = true;
		
		bets[msg.sender].currentBet = random();
		bets[msg.sender].bet=_bet;
        bets[msg.sender].isHigher=_isHigher;
		emit NewBetIsSet(msg.sender,bets[msg.sender].currentBet);
		return bets[msg.sender].currentBet;
	}
	
	function roll() public returns(address , uint8 , uint8){
		require(bets[msg.sender].isBetSet == true);
		bets[msg.sender].destiny = random()+1;
		
		bets[msg.sender].isBetSet = false;
		if(bets[msg.sender].isHigher==true && bets[msg.sender].destiny> bets[msg.sender].currentBet ){
			msg.sender.transfer(bets[msg.sender].bet);
			emit GameResult(msg.sender, bets[msg.sender].currentBet, bets[msg.sender].destiny);	

		}
        else if(bets[msg.sender].isHigher==false && bets[msg.sender].destiny< bets[msg.sender].currentBet ){
            msg.sender.transfer(bets[msg.sender].bet);
			emit GameResult(msg.sender, bets[msg.sender].currentBet, bets[msg.sender].destiny);
        }
        else{
		    receiver.transfer(bets[msg.sender].bet);
			emit GameResult(msg.sender, bets[msg.sender].currentBet, bets[msg.sender].destiny);
		}
		return (msg.sender , bets[msg.sender].currentBet , bets[msg.sender].destiny);
	}
	
    function random() private view returns (uint8) {
       return uint8(uint256(block.timestamp+block.difficulty)%10);
   }
   function()  external payable{}
      
    
    


}
